import { MdRemove, MdPlaylistAdd } from 'react-icons/md';
import { Butt_Add } from '../components/Butt_Add';

export default class Proc extends Component {
render() {
	return (
		<div className="card card-body my-3">
		  	<div className="instruction"> Ask a question and let participants 
	                choose from a list of answers.
	        </div>
        		<input
                  type="text"
                  className="form-control"
                  placeholder="Type the Question"
                  className="txt-ques"
                  readOnly="readOnly"
                />

		  </div>
		)
	}
}
